import React, { useState, useEffect } from "react";
import { BaseCrudService } from "../../../base/BaseCrudService";
import { Link } from "react-router-dom";
import { IDummy } from "../../../domain/IDummy";

const DummyIndex = () => {
    const [drinks, setDrinks] = useState([] as IDummy[]);

    const data = async () => await BaseCrudService
            .getEntities<IDummy>('dummies')
            .then(data => setDrinks(data));

    useEffect(() => {
        data();
    }, [drinks.length]);

    const deleteDrink = async (id: string) => {
        await BaseCrudService.deleteEntity(id, 'dummies');
        data();
    }

    return (
        <>
            <h1>Dummies</h1>
            <Link to="/dummies/create">Create new </Link>
            <div style={{ display: 'flex', flexWrap: 'wrap' }}>
                <div>
                    {drinks.map(dummy =>
                        <form key={dummy.id}>
                            <div className="card">
                                <div className="card-body">
                                    <h5 className="card-title">{dummy.dumbo}</h5>
                                    <Link to={'/dummies/' + dummy.id}>Details</Link>
                                    <div onClick={(e) => deleteDrink(dummy.id)}>Delete</div>
                                </div> 
                            </div>
                        </form>
                    )}
                </div>
            </div >

        </>
    );
}

export default DummyIndex;
